import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-p">
      <p>Natascha Henriksen</p>
      <p>Email <br /> nataschavejenhenriksen@gmail.com</p>
      <a href="https://www.instagram.com/natascha_henriksen/" className="instagram">Instagram</a>/a>
      <p> Facebook <br />QuietlyThriving</p>
      </div>
    </div>
  );
};

export default Footer;
